const DmSansRegular = `@font-face { font-family: 'DM Sans'; font-style: normal; font-weight: 400; src: local('DM Sans Regular'), local('DMSans-Regular'), url('data:font/woff2;base64,') format('woff2'); }`;
const DmSansItalic = `@font-face { font-family: 'DM Sans'; font-style: italic; font-weight: 400; src: local('DM Sans Italic'), local('DMSans-Italic'), url('data:font/woff2;base64,') format('woff2'); }`;
const DmSans500 = `@font-face { font-family: 'DM Sans'; font-style: normal; font-weight: 500; src: local('DM Sans Medium'), local('DMSans-Medium'), url('data:font/woff2;base64,') format('woff2'); }`;
const DmSans500italic = `@font-face { font-family: 'DM Sans'; font-style: italic; font-weight: 500; src: local('DM Sans Medium Italic'), local('DMSans-MediumItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
const DmSans700 = `@font-face { font-family: 'DM Sans'; font-style: normal; font-weight: 700; src: local('DM Sans Bold'), local('DMSans-Bold'), url('data:font/woff2;base64,') format('woff2'); }`;
const DmSans700italic = `@font-face { font-family: 'DM Sans'; font-style: italic; font-weight: 700; src: local('DM Sans Bold Italic'), local('DMSans-BoldItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
